import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import Image from "../images/myAvatar.png";
import { Avatar } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
const useStyles = makeStyles(theme => ({
  root: {
    display: "flex",
    paddingTop: "400px",
    "& > *": {
      margin: theme.spacing(1)
    },
    large: {
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      width: theme.spacing(7),
      height: theme.spacing(7)
    }
  }
}));
export default function ThirdPage() {
  const classes = useStyles();
  return (
    <Container fixed>
      <Typography variant="h3">Front End Developer, UX/UI, Buisness</Typography>
      <Typography variant="h5">I code, I review, I drink coffee</Typography>

      <img align="center" src={Image} />

      <Typography variant="h4">Axel Lor√©n</Typography>
      <Typography variant="h5">And I'm A Front End Developer</Typography>
    </Container>
  );
}
